import { Breadcrumb } from "antd";
const MenuNavibarLayout = ({ menus }) => {
  console.log(menus);
  return (
    <Breadcrumb>
      {menus.map((menu) => {
        // console.log(menu);
        <Breadcrumb.Item>
          <h2>{menu}</h2>
        </Breadcrumb.Item>;
      })}
    </Breadcrumb>
  );
};

export default MenuNavibarLayout;
